import React, { useState, useEffect } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './CarDetails.css';

const IMAGE_BASE_URL = 'http://localhost:5000'; // backend port

const CarDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [car, setCar] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchCarDetails = async () => {
      try {
        const res = await axios.get(`/api/cars/${id}`);
        setCar(res.data);
      } catch (err) {
        console.error(err);
      } finally {
        setLoading(false);
      }
    };
    fetchCarDetails();
  }, [id]);

  if (loading) return <div className="loading">Loading car details...</div>;
  if (!car) return <div className="container">Car not found</div>;

  const imageSrc = car.image?.startsWith('http')
    ? car.image
    : `${IMAGE_BASE_URL}${car.image}`;

  return (
    <div className="car-details">
      <div className="container">
        <Link to="/" className="back-link">← Back to Home</Link>

        <div className="car-details-grid">
          {/* IMAGE */}
          <div className="image-card">
            <img
              src={imageSrc}
              alt={car.name}
              onError={(e) => (e.target.src = '/car-placeholder.jpg')}
            />
            <span className={`badge ${car.available ? 'available' : 'unavailable'}`}>
              {car.available ? 'Available' : 'Not Available'}
            </span>
          </div>

          {/* INFO */}
          <div className="info-card">
            <h1>{car.name || 'Car Name'}</h1>
            <p className="subtitle">
              {[car.brand, car.model, car.year].filter(Boolean).join(' • ')}
            </p>

            <div className="specs">
              <div className="spec"><span>Seats</span><strong>{car.seats || '-'}</strong></div>
              <div className="spec"><span>Transmission</span><strong>{car.transmission || '-'}</strong></div>
              <div className="spec"><span>Fuel</span><strong>{car.fuelType || '-'}</strong></div>
            </div>

            {car.description && (
              <div className="description">
                <h3>Description</h3>
                <p>{car.description}</p>
              </div>
            )}

            <div className="pricing">
              <h3>Pricing</h3>
              {car.price30min && <div><span>30 Min</span><strong>{car.price30min} AED</strong></div>}
              {car.price60min && <div><span>60 Min</span><strong>{car.price60min}  AE D</strong></div>}
              {car.pricePerDay && <div><span>Per Day</span><strong>{car.pricePerDay} AED</strong></div>}
            </div>

            <button
              className="book-btn"
              disabled={!car.available}
              onClick={() => navigate(`/booking/${id}`)}
            >
              {car.available ? 'Book Now' : 'Currently Unavailable'}
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CarDetails;
